import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header";
import MainContent from "./MainContent";



function Footer() {

}

function WholePage() {
    return (
        <div>
            <Header />
            <MainContent />
            <Footer />
        </div>
    )
 }

ReactDOM.render(<WholePage />, document.getElementById("root"));
